def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if isinstance(group_axis, MultiIndex):
        raise ValueError("Grouping by columns is not supported with MultiIndex.")

    if level is not None:
        if isinstance(level, str):
            if obj.columns.name != level:
                raise ValueError("level name {} is not the name of the columns".format(level))
        elif level > 0 or level < -1:
            raise ValueError("level > 0 or level < -1 only valid with columns")

        key = group_axis

    if axis == 1:
        if key is None or isinstance(key, str):
            key = obj.columns

    groupings = []
    exclusions = []

    for gpr in key:
        if is_categorical_dtype(gpr) and len(gpr) != obj.shape[axis]:
            raise ValueError(
                "Length of grouper ({len_gpr}) and axis ({len_axis}) must be the same length".format(
                    len_gpr=len(gpr), len_axis=obj.shape[axis]
                )
            )
        ping = Grouping(
            group_axis,
            gpr,
            obj=obj,
            name=str(gpr),
            level=level,
            sort=sort,
            observed=observed,
            in_axis=True,
        )
        groupings.append(ping)

    if len(groupings) == 0:
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
